import React, { useEffect, useState } from "react";


function SignupPage() {
    return (
        <div className="SignupPage">
            <br />
            <InputForm />
            <br />
            <SignupButton />
            <br />
        </div>
    );
}

function InputForm(){
    return(
        <div className="InputFom">
            <form>
                id (email) : <input id='inputId' type='email'></input>&nbsp;&nbsp;
                <button type='button' >{ "check" }</button><br />
                password : <input id='inputPassword' type='email'></input>&nbsp;&nbsp;
            </form>
        </div>
    );
}

// 버튼 구성 
function SignupButton(){
    let [ btnName, setBtnName ] = useState(['Sign up', 'Cancle'])
    return(
        <div>
            <button type='button' >{ btnName[0] }</button>&nbsp;&nbsp;&nbsp;&nbsp;
            <button type='button' >{ btnName[1] }</button>
        </div>
    );
}


export default SignupPage;
